// The SVG viewBox size for all tiles
export const TILE_VIEWBOX_SIZE = 118.58;
// Direction mappings for hex neighbors (pointy-top orientation)
// These match the order returned by hexNeighbors()
export const DIRECTION_NAMES = ['E', 'NE', 'NW', 'W', 'SW', 'SE'];
// Map direction index to direction name
export function getDirectionName(index) {
    return DIRECTION_NAMES[index];
}
// Get the opposite direction
export function getOppositeDirection(dir) {
    const opposites = {
        'E': 'W', 'W': 'E',
        'NE': 'SW', 'SW': 'NE',
        'NW': 'SE', 'SE': 'NW'
    };
    return opposites[dir];
}
